import React from "react";
import Card from "./Card";

function Team() {
  let info = [
    {
      id: 7,
      name: "Haitam SKHAIRI",
      position: "Front End Developer",
      phone: "+212613411697",
      email: "haitam.skhairi@gmail.com",
      website: "www.haitamskhairi.com",
    },
    {
      id: 3,
      name: "Haitam SKHAIRI",
      position: "Front End Developer",
      phone: "+212613411697",
      email: "haitam.skhairi@gmail.com",
      website: "www.haitamskhairi.com",
    },
    {
      id: 1,
      name: "Haitam SKHAIRI",
      position: "Front End Developer",
      phone: "+212613411697",
      email: "haitam.skhairi@gmail.com",
      website: "www.haitamskhairi.com",
    },
    {
      id: 2,
      name: "Haitam SKHAIRI",
      position: "Front End Developer",
      phone: "+212613411697",
      email: "haitam.skhairi@gmail.com",
      website: "www.haitamskhairi.com",
    },
    {
      id: 8,
      name: "Haitam SKHAIRI",
      position: "Front End Developer",
      phone: "+212613411697",
      email: "haitam.skhairi@gmail.com",
      website: "www.haitamskhairi.com",
    },
    {
      id: 4,
      name: "Haitam SKHAIRI",
      position: "Front End Developer",
      phone: "+212613411697",
      email: "haitam.skhairi@gmail.com",
      website: "www.haitamskhairi.com",
    },
    {
      id: 5,
      name: "Haitam SKHAIRI",
      position: "Front End Developer",
      phone: "+212613411697",
      email: "haitam.skhairi@gmail.com",
      website: "www.haitamskhairi.com",
    },
    {
      id: 6,
      name: "Haitam SKHAIRI",
      position: "Front End Developer",
      phone: "+212613411697",
      email: "haitam.skhairi@gmail.com",
      website: "www.haitamskhairi.com",
    },
  ];

  let members = info.map((member) => {
    return (
      <Card
        key={member.id}
        name={member.name}
        position={member.position}
        phone={member.phone}
        email={member.email}
        website={member.website}
      />
    );
  });

  return <div className="row gap-1">{members}</div>;
}

export default Team;
